script: |
  super -f text -I q730.spq | sort > q730.out

inputs:
  - name: q730.spq
    data: |
      SELECT DISTINCT * FROM tab1 (FORMAT parquet) WHERE NOT ( + ( + - 49 ) - + col0 ) BETWEEN - 49 + + col1 AND + 21 + - 96;
  - name: tab1

outputs:
  - name: q730.out
    data: |
      51	14	96
      85	5	59
      91	47	68
